import { useEffect, useState } from "react";

const Main = () => {
  let initArray = { items: [] };
  const [data, setData] = useState(initArray);

  const CreateData = () => {
    for (let i = 1; i < 51; i++) {
      let item = {
        imagePath: `https://picsum.photos/1000/1000?random=${i}`,
        views: Math.floor(Math.random() * 1000),
        likes: Math.floor(Math.random() * 100),
        name: `Picture of number ${i}`,
        date: "YYYY-MM-DD hh:mm",
      };

      initArray.items.push(item);
      console.log(initArray);
    }
    setData((oldData) => ({ ...oldData, ...initArray }));
  };

  function Items({ currentItems }) {}

  function PaginatedItems({ itemsPerPage }) {
    const [itemOffset, setItemOffset] = useState(0);
    const endOffset = itemOffset + itemsPerPage;
    const currentItems = items.slice(itemOffset, endOffset);
    const pageCount = Math.ceil(items.length / itemsPerPage);
    const handlePageClick = (event) => {
      const newOffset = (event.selected * itemsPerPage) % items.length;
      setItemOffset(newOffset);
    };
  }

  useEffect(() => {
    return () => {
      CreateData();
    };
  }, []);
  console.log(data);

  return (
    <>
      <main>
        <div className="main-container">
          <div className="result-container">
            <div className="result-pagination">
              <div className="result-pag-item">Option1</div>
              <div className="result-pag-item">Option2</div>
              <div className="result-pag-item">Option3</div>
            </div>
            <div className="result-grid">
              {data.items.map((element) => (
                <div key={element.name} className="result-grid-element">
                  <div className="result-element-container">
                    <div
                      className="result-img"
                      style={{
                        backgroundImage: `url("${element.imagePath}")`,
                      }}
                    ></div>
                    <div className="result-text">
                      <div className="result-title">{element.name}</div>
                      <div className="result-analitics-container">
                        <div>Likes: {element.likes}</div>
                        <div>Added: {element.date}</div>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </main>
    </>
  );
};

export default Main;
